import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'ol/ol.css';
import { Map } from 'ol';
import { View } from 'ol';
import TileLayer from 'ol/layer/Tile';
import XYZ from 'ol/source/XYZ';
import { fromLonLat } from 'ol/proj';
import { Icon, Style } from 'ol/style';
import VectorLayer from 'ol/layer/Vector';
import VectorSource from 'ol/source/Vector';
import Feature from 'ol/Feature';
import Point from 'ol/geom/Point';

const AssetOverview = () => {
    const [assets, setAssets] = useState([]);
    const [error, setError] = useState(null);

    const fetchFinalDataset = async () => {
        try {
            const response = await axios.get('http://127.0.0.1:5000/get_pipeline_stage');
            if (response.data.step < 2) {
                setError('Pipeline not complete. Complete all stages to view assets.');
                setAssets([]);
            } else {
                setAssets(response.data.dataset || []);
            }
        } catch (err) {
            setError('Error fetching final dataset.');
            console.error(err);
        }
    };

    useEffect(() => {
        fetchFinalDataset();
    }, []);

    useEffect(() => {
        if (assets.length === 0) return; // Don't initialize the map if there are no assets

        // Create a map instance
        const map = new Map({
            target: 'map', // HTML container ID
            layers: [
                new TileLayer({
                    source: new XYZ({
                        url: 'https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png',
                    }),
                }),
            ],
            view: new View({
                center: fromLonLat([-122.4194, 37.7749]), // San Francisco coordinates
                zoom: 4,
            }),
        });

        // Add markers for assets
        const vectorLayer = new VectorLayer({
            source: new VectorSource(),
        });
        map.addLayer(vectorLayer);

        assets.forEach(asset => {
            const marker = new Feature({
                geometry: new Point(fromLonLat([asset.Longitude, asset.Latitude])),
            });
            marker.setStyle(new Style({
                image: new Icon({
                    src: 'https://openlayers.org/en/v6.9.0/examples/data/icon.png', // Default marker icon
                    scale: 0.05,
                }),
            }));
            vectorLayer.getSource().addFeature(marker);
        });

        return () => map.setTarget(null); // Cleanup the map on component unmount
    }, [assets]);

    return (
        <div style={{ padding: '20px' }}>
            <h2>Asset Overview</h2>
            {error && <p style={{ color: 'red' }}>{error}</p>}

            {/* OpenLayers Map */}
            <div
                id="map"
                style={{
                    width: '100%',
                    height: '500px', // Ensure height is defined for the map to display
                    marginBottom: '20px',
                    border: '1px solid #ccc', // Add a border to ensure visibility
                }}
            ></div>

            {/* Display Final Dataset */}
            <div style={{ marginTop: '30px' }}>
                <h3>Final Dataset</h3>
                <table style={{ width: '100%', borderCollapse: 'collapse' }}>
                    <thead>
                        <tr>
                            <th style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left' }}>Asset</th>
                            <th style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left' }}>Latitude</th>
                            <th style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left' }}>Longitude</th>
                            <th style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'left' }}>Operational Status</th>
                        </tr>
                    </thead>
                    <tbody>
                        {assets.map((asset, index) => (
                            <tr key={index}>
                                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{asset.Asset}</td>
                                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{asset.Latitude}</td>
                                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{asset.Longitude}</td>
                                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{asset.OperationalStatus}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default AssetOverview;
